class NextGreaterElement2 {
    fun nextGreaterElements(nums: IntArray): IntArray {
        val array = mutableListOf<Int>()

        nums.mapIndexed { index, num ->
            val stack = Stack<Pair<Int, Int>>()
            nums.mapIndexed loop@{ findIndex, i ->
                if (index == findIndex || num >= i) {
                    return@loop
                }

                if (index < findIndex) {
                    array.add(i)
                    return@mapIndexed
                }

                stack.push(Pair(findIndex, i))
            }

            if (stack.isEmpty()) {
                array.add(-1)
                return@mapIndexed
            }

            array.add(stack.first().second)
        }

        return array.toIntArray()
    }
}

